static inline __attribute__((always_inline)) uint16_t adc_2_dac_scale(uint16_t val)
{
	uint32_t temp = ((uint32_t)val * 330) / 250;
	return (uint32_t)temp & 0xFFFF;
}

#define PI 3.14159265f

void prepare_sin_table(uint16_t *samples, uint32_t sample_count, uint32_t freq, uint32_t sampling_freq)
{
	for (uint32_t i = 0; i < sample_count; ++i)
	{
		float t = (float)i / sampling_freq;
		float signal = round((sin(2 * PI * freq * t) + 1) * 4095) / 2;
		samples[i] = (uint16_t)(signal);
	}
}

void set_voltage(spi_host_t *SPI, enum CHANNEL ch, uint32_t val, const uint32_t *cmd_set_voltage)
{
	uint32_t cmd = 0x03000000 | (ch << 20) | ((val & 0xFFF) << 8);
	spi_write_word(SPI, __builtin_bswap32(cmd)); // This sends the given command according to the mode specified in the command fifo
	spi_set_command(SPI, *cmd_set_voltage);		 // This writes the command information in the command fifo
	spi_wait_for_ready(SPI);
}

uint16_t mask = __builtin_bswap16(0xFFF);
uint16_t get_voltage(spi_host_t *SPI, const uint32_t *cmd_get_voltage)
{
	// spi_wait_for_ready(SPI);
	spi_set_command(SPI, *cmd_get_voltage);
	spi_wait_for_ready(SPI);
	// For somereason watermark fuck everything up... from 98KHz to 50KHz
	spi_wait_for_rx_watermark(SPI); // TRY TO GET RID OF THIS
	uint32_t res;
	spi_read_word(SPI, &res);
	return ((uint16_t)(res & mask));
}

void write_to_flash(spi_host_t *SPI, dma_t *DMA, uint16_t *data, uint32_t byte_count, uint32_t addr)
{
#ifdef PHYSICAL_FLASH
	uint32_t chunks = byte_count / 256;
	uint32_t remainder = byte_count % 256;
	printf("Chunks: %u, remainer: %u\n\r", chunks, remainder);
	// We can write only 256 bytes at a time.
	uint32_t i;
	for (i = 0; i < chunks; ++i)
	{
		write_to_flash_256_bytes_max(SPI, DMA, (uint8_t *)data + 256 * i, 256, addr + 256 * i);
	}
	if (remainder)
		write_to_flash_256_bytes_max(SPI, DMA, (uint8_t *)data + 256 * i, remainder, addr + 256 * i);
#else

	uint32_t write_to_mem = 0x02;
	spi_write_word(SPI, write_to_mem);
	uint32_t cmd_write_to_mem = spi_create_command((spi_command_t){
		.len = 0,
		.csaat = true,
		.speed = kSpiSpeedStandard,
		.direction = kSpiDirTxOnly});
	spi_set_command(SPI, cmd_write_to_mem);
	spi_wait_for_ready(SPI);

	uint32_t addr_cmd = __builtin_bswap32(addr); // 0xF8F00200;
	spi_write_word(SPI, addr_cmd);
	uint32_t cmd_address = spi_create_command((spi_command_t){
		.len = 3,
		.csaat = true,
		.speed = kSpiSpeedStandard,
		.direction = kSpiDirTxOnly});
	spi_set_command(SPI, cmd_address);
	spi_wait_for_ready(SPI);

	uint32_t *fifo_ptr_tx = SPI->base_addr.base + SPI_HOST_TXDATA_REG_OFFSET;

	// -- DMA CONFIGURATION --
	dma_set_read_ptr_inc(DMA, (uint32_t)2);
	dma_set_write_ptr_inc(DMA, (uint32_t)0); // Do not increment address when reading from the SPI (Pop from FIFO)
	dma_set_read_ptr(DMA, (uint32_t)data);
	dma_set_write_ptr(DMA, (uint32_t)fifo_ptr_tx);
	// Set the correct SPI-DMA mode:
	// (0) disable
	// (1) receive from SPI (use SPI_START_ADDRESS for spi_host pointer)
	// (2) send to SPI (use SPI_START_ADDRESS for spi_host pointer)
	// (3) receive from SPI FLASH (use SPI_FLASH_START_ADDRESS for spi_host pointer)
	// (4) send to SPI FLASH (use SPI_FLASH_START_ADDRESS for spi_host pointer)
	dma_set_spi_mode(DMA, (uint32_t)4);			  // The DMA will wait for the SPI FLASH TX FIFO ready signal
	dma_set_data_type(DMA, (uint32_t)1);		  // 1 is for 16-bits
	dma_set_cnt_start(DMA, (uint32_t)byte_count); // Size of data received by SPI

	// Wait for the first data to arrive to the TX FIFO before enabling interrupt
	spi_wait_for_tx_not_empty(SPI);
	// Enable event interrupt
	spi_enable_evt_intr(SPI, true);
	// Enable TX empty interrupt
	spi_enable_txempty_intr(SPI, true);

	const uint32_t cmd_write_tx = spi_create_command((spi_command_t){
		.len = byte_count - 1,
		.csaat = false,
		.speed = kSpiSpeedStandard,
		.direction = kSpiDirTxOnly});
	spi_set_command(SPI, cmd_write_tx);
	spi_wait_for_ready(SPI);

	// Wait for SPI interrupt
	// printf("Waiting for the SPI interrupt...\n\r");
	while (spi_intr_flag == 0)
	{
		wait_for_interrupt();
	}
	// printf("triggered!\n\r");

	printf("%d Bytes written in Flash at @0x%08x \n\r", byte_count, addr);

#endif
}

void write_to_flash_256_bytes_max(spi_host_t *SPI, dma_t *DMA, uint16_t *data, uint32_t byte_count, uint32_t addr)
{
	printf("Writing to flash %u bytes at addr %u\n\r", byte_count, addr);
	// Write enable
	const uint32_t write_enable_cmd = 0x06;
	spi_write_word(SPI, write_enable_cmd);
	const uint32_t cmd_write_en = spi_create_command((spi_command_t){
		.len = 0,
		.csaat = false,
		.speed = kSpiSpeedStandard,
		.direction = kSpiDirTxOnly});
	spi_set_command(SPI, cmd_write_en);
	spi_wait_for_ready(SPI);

	// Write command
	const uint32_t write_byte_cmd = ((addr << 8) | 0x02); // Program Page + addr
	spi_write_word(SPI, write_byte_cmd);
	const uint32_t cmd_write = spi_create_command((spi_command_t){
		.len = 3,
		.csaat = true,
		.speed = kSpiSpeedStandard,
		.direction = kSpiDirTxOnly});
	spi_set_command(SPI, cmd_write);
	spi_wait_for_ready(SPI);

	uint32_t *fifo_ptr_tx = SPI->base_addr.base + SPI_HOST_TXDATA_REG_OFFSET;

	// -- DMA CONFIGURATION --
	// NOTE: 16-bit --> 2
	dma_set_read_ptr_inc(DMA, (uint32_t)2);		   // Do not increment address when reading from the SPI (Pop from FIFO)
	dma_set_write_ptr_inc(DMA, (uint32_t)0);	   // Do not increment address when reading from the SPI (Pop from FIFO)
	dma_set_read_ptr(DMA, (uint32_t)data);		   // SPI RX FIFO addr
	dma_set_write_ptr(DMA, (uint32_t)fifo_ptr_tx); // copy data address
												   //
												   //
												   // Set the correct SPI-DMA mode:
												   // (0) disable
												   // (1) receive from SPI (use SPI_START_ADDRESS for spi_host pointer)
												   // (2) send to SPI (use SPI_START_ADDRESS for spi_host pointer)
												   // (3) receive from SPI FLASH (use SPI_FLASH_START_ADDRESS for spi_host pointer)
												   // (4) send to SPI FLASH (use SPI_FLASH_START_ADDRESS for spi_host pointer)
	dma_set_spi_mode(DMA, (uint32_t)4);			   // The DMA will wait for the SPI FLASH TX FIFO ready signal
	dma_set_data_type(DMA, (uint32_t)1);		   // NOTE: 16-bit
	dma_set_cnt_start(DMA, (uint32_t)byte_count);  // Size of data received by SPI

	// Wait for the first data to arrive to the TX FIFO before enabling interrupt
	spi_wait_for_tx_not_empty(SPI);
	// Enable event interrupt
	spi_enable_evt_intr(SPI, true);
	// Enable TX empty interrupt
	spi_enable_txempty_intr(SPI, true);

	const uint32_t cmd_write_tx = spi_create_command((spi_command_t){
		.len = byte_count - 1,
		.csaat = false,
		.speed = kSpiSpeedStandard,
		.direction = kSpiDirTxOnly});
	spi_set_command(SPI, cmd_write_tx);
	spi_wait_for_ready(SPI);

	// Wait for SPI interrupt
	// printf("Waiting for the SPI interrupt...\n\r");
	while (spi_intr_flag == 0)
	{
		wait_for_interrupt();
	}
	// printf("triggered!\n\r");

	// Check status register status waiting for ready
	bool flash_busy = true;
	uint8_t flash_resp[4] = {0xff, 0xff, 0xff, 0xff};
	while (flash_busy)
	{
		uint32_t flash_cmd = 0x00000005; // [CMD] Read status register
		spi_write_word(SPI, flash_cmd);	 // Push TX buffer
		uint32_t spi_status_cmd = spi_create_command((spi_command_t){
			.len = 0,
			.csaat = true,
			.speed = kSpiSpeedStandard,
			.direction = kSpiDirTxOnly});
		uint32_t spi_status_read_cmd = spi_create_command((spi_command_t){
			.len = 0,
			.csaat = false,
			.speed = kSpiSpeedStandard,
			.direction = kSpiDirRxOnly});
		spi_set_command(SPI, spi_status_cmd);
		spi_wait_for_ready(SPI);
		spi_set_command(SPI, spi_status_read_cmd);
		spi_wait_for_ready(SPI);
		spi_wait_for_rx_watermark(SPI);
		spi_read_word(SPI, &flash_resp[0]);
		if ((flash_resp[0] & 0x01) == 0)
			flash_busy = false;
	}
	// printf("Finished Writing to Flash!\n\r");
}

#define ARR_2D_GET_VAL(float_arr2d, x, y) float_arr2d.data[y * float_arr2d.first + x]
#define ARR_2D_SET_VAL(float_arr2d, x, y, val) ARR_2D_GET_VAL(float_arr2d, x, y) = val

struct float_array2d
{
	uint32_t first;
	uint32_t second;
	float *data;
};

#define ARR_3D_GET_VAL(float_arr3d, x, y, z) float_arr3d.data[z * float_arr3d.first * float_arr3d.second + y * float_arr3d.first + x]
#define ARR_3D_SET_VAL(float_arr3d, x, y, z, val) ARR_3D_GET_VAL(float_arr3d, x, y, z) = val

struct float_array3d
{
	uint32_t first;
	uint32_t second;
	uint32_t third;
	float *data;
};

struct float_array1d
{
	uint32_t first;
	float *data;
};

// NOTE: x is first dimensions, y second, and z third

// Input shape: LENGTH x IN_CHANNELS
// Weight shape: IN_CHANNELS x OUT_CHANNELS x KERNEL_SIZE
// Output shape: LENGTH x OUT_CHANNELS
// Bias shape: OUT_CHANNELS
void conv1d(struct float_array2d inputs, struct float_array2d outputs, struct float_array3d weights, struct float_array1d biases, uint32_t stride)
{
	assert(stride > 0);
	assert(inputs.second == weights.first);
	assert(outputs.second == biases.first);
	assert(outputs.second == weights.second);
	assert(outputs.first == (inputs.first - weights.third) / stride + 1);

	for (uint32_t output_channel = 0; output_channel < outputs.second; ++output_channel) // Output Channel
	{
		uint32_t output_x = 0;
		for (uint32_t i = 0; i < inputs.first - weights.third + 1; i += stride)
		{
			float sum = biases.data[output_channel];
			for (uint32_t k = 0; k < weights.third; ++k)
			{
				for (uint32_t input_channel = 0; input_channel < inputs.second; ++input_channel) // Input Channel
				{
					sum += ARR_2D_GET_VAL(inputs, i + k, input_channel) * ARR_3D_GET_VAL(weights, input_channel, output_channel, k);
				}
			}
			ARR_2D_SET_VAL(outputs, output_x, output_channel, sum);
			++output_x;
		}
	}
}

// Assumes default stride = kernel_size
// Input shape: LENGTH x IN_CHANNELS
// Output shape: LENGTH x OUT_CHANNELS
void avg_pool1d(struct float_array2d inputs, struct float_array2d outputs, uint32_t kernel_size)
{
	assert(kernel_size > 0);
	assert(inputs.second == outputs.second);
	assert(inputs.first / kernel_size == outputs.first);

	for (uint32_t channel = 0; channel < inputs.second; ++channel)
	{
		uint32_t output_x = 0;
		for (uint32_t i = 0; i + kernel_size - 1 < inputs.first; i += kernel_size)
		{
			float sum = 0;
			for (uint32_t k = 0; k < kernel_size; ++k)
			{
				sum += ARR_2D_GET_VAL(inputs, i + k, channel);
			}
			ARR_2D_SET_VAL(outputs, output_x, channel, sum / kernel_size);
			++output_x;
		}
	}
}

// Input shape: LENGTH x IN_CHANNELS
// Output shape: LENGTH x OUT_CHANNELS
void relu2d(struct float_array2d inputs, struct float_array2d outputs)
{
	assert(inputs.first == outputs.first);
	assert(inputs.second == outputs.second);

	float val;
	for (uint32_t channel = 0; channel < inputs.second; ++channel)
	{
		for (uint32_t i = 0; i < inputs.first; ++i)
		{
			val = ARR_2D_GET_VAL(inputs, i, channel);
			if (val < 0.0f)
				val = 0;
			ARR_2D_SET_VAL(outputs, i, channel, val);
		}
	}
}

// Input shape: LENGTH x IN_CHANNELS
// Output shape: LENGTH x OUT_CHANNELS
void relu1d(struct float_array1d inputs, struct float_array1d outputs)
{
	assert(inputs.first == outputs.first);

	float val;
	for (uint32_t i = 0; i < inputs.first; ++i)
	{
		val = inputs.data[i];
		if (val < 0.0f)
			val = 0;
		outputs.data[i] = val;
	}
}

// Input shape: LENGTH x IN_CHANNELS
// Output shape: LENGTH
// Axis: 0 -> first 1-> second
void flatten(struct float_array2d inputs, struct float_array1d outputs, uint8_t axis)
{
	assert(outputs.first == inputs.first * inputs.second);

	float val;
	uint32_t out_x = 0;
	if (axis == 1)
	{
		for (uint32_t channel = 0; channel < inputs.second; ++channel)
		{
			for (uint32_t i = 0; i < inputs.first; ++i)
			{
				val = ARR_2D_GET_VAL(inputs, i, channel);
				outputs.data[out_x++] = val;
			}
		}
	}
	else
	{
		for (uint32_t i = 0; i < inputs.first; ++i)
		{
			for (uint32_t channel = 0; channel < inputs.second; ++channel)
			{
				val = ARR_2D_GET_VAL(inputs, i, channel);
				outputs.data[out_x++] = val;
			}
		}
	}
}

// Input shape: IN_CHANNELS
// Weight shape: IN_CHANNELS x OUT_CHANNELS
// Output shape: OUT_CHANNELS
// Bias shape: OUT_CHANNELS
void linear(struct float_array1d inputs, struct float_array1d outputs, struct float_array2d weights, struct float_array1d biases)
{
	assert(inputs.first == weights.first);
	assert(outputs.first == biases.first);
	assert(outputs.first == weights.second);

	for (uint32_t output_channel = 0; output_channel < weights.second; ++output_channel)
	{
		float sum = biases.data[output_channel];
		for (uint32_t input_channel = 0; input_channel < weights.first; ++input_channel)
		{
			sum += inputs.data[input_channel] * ARR_2D_GET_VAL(weights, input_channel, output_channel);
		}
		outputs.data[output_channel] = sum;
	}
}

void print_tensor3d(struct float_array3d tensor)
{
	for (uint32_t k = 0; k < tensor.second; ++k)
	{
		printf("[\n");
		for (uint32_t i = 0; i < tensor.first; ++i)
		{
			printf("[\n");
			for (uint32_t j = 0; j < tensor.third; ++j)
			{
				printf("%f ", ARR_3D_GET_VAL(tensor, i, k, j));
			}
			printf("\n]\n");
		}
		printf("\n]\n");
	}
	printf("\n");
	printf("\n");
	printf("\n");
}

void print_tensor2d(struct float_array2d tensor)
{
	for (uint32_t k = 0; k < tensor.second; ++k)
	{
		printf("[\n");
		for (uint32_t i = 0; i < tensor.first; ++i)
		{
			printf("%f ", ARR_2D_GET_VAL(tensor, i, k));
		}
		printf("]\n");
	}
	printf("\n");
	printf("\n");
	printf("\n");
}

void normalize(uint16_t x[35000], float output[35000])
{
	float mean = 0;
	float max = 0;
	for(uint32_t i = 0; i < 35000; ++i)
	{
		float x_i = (float)x[i];
		mean += x_i;
		if(x_i > max)
			max = x_i;
	}
	mean /= 35000;

	for(uint32_t i = 0; i < 35000; ++i)
	{
		output[i] = ((float)x[i] - mean) / max;
	}
}

